# This is a simple Fibonacci sequence challenge.
# The next number is the sum of the previous two numbers.

def fibonacci_sequence(n):
    if n <= 0:
        return []
    elif n == 1:
        return [1]
    elif n == 2:
        return [1, 1]
    else:
        sequence = [1, 1]
        for i in range(2, n):
            sequence.append(sequence[-1] + sequence[-2])
        return sequence

# Generate the sequence up to the 12th number
sequence = fibonacci_sequence(12)
print(sequence)

# The next number in the sequence
next_number = sequence[-1] + sequence[-2]
print(next_number)
